.dataworksAcProject {
  height: calc(100vh - 135px);
  background: #fff;
  margin: 0 16px 16px 16px;
  padding: 16px;
  border-radius: 8px;
  overflow: hidden;
  position: relative;
  .condition {
    height: 40px;
    ::v-deep .el-form {
      height: 100%;
      .el-form-item__label {
        font-weight: 400;
        color: #202224;
      }
    }
    .el-row {
      /*margin-bottom: 20px;*/
      &:last-child {
        margin-bottom: 0;
      }
    }
    .el-col {
      border-radius: 4px;
    }
  }

  .content{
    height: calc(100% - 40px);
    .el-button {
      margin: 0;
    }
  }
  @import "./style.scss";
  // 表格
  .el-table {
    margin-top: 10px;
  }
  // 分页
  .pagination {
    position: absolute;
    bottom: 10px;
    right: 20px;
    //height: 64px;
    display: flex;
    align-items: center;
    flex-direction: row-reverse;
    .el-pagination {
      margin: 0;
    }
  }

}
